import React, { Component } from 'react'
import {url} from '../../components'
export default class SubjectList extends Component {
    componentDidMount(){
        const {data} = this.props.location.state;
        fetch(url + 'subject/:classId')
    }
    render() {
        return (
            <div>
                <h1>SubjectList</h1>
            </div>
        )
    }
}
